package main

import (
	"encoding/base64"
	"fmt"
	"os"
	"strings"
)

var base64Str = "data:image/jpeg;base64,"

func main() {
	saveBase64ToImage(base64Str, "1.png")
}

func saveBase64ToImage(base64Str string, fileName string) bool {
	baseArr := strings.Split(base64Str, ",")
	baseData := baseArr[1]

	bytes, _ := base64.StdEncoding.DecodeString(baseData)
	//err := ioutil.WriteFile(fileName, bytes, 0666)
	//if err != nil {
	//	fmt.Println(err)
	//}
	fp, err := os.Create(fileName)
	if err != nil {
		fmt.Println("创建文件失败：", err)
		return false
	}
	defer fp.Close()
	n, err := fp.Write(bytes)
	if err != nil {
		fmt.Println("写入文件失败：", err)
	}

	fmt.Println(n)
	return true
}
